import React, { useState } from "react";

import { Link } from "react-router-dom";

const Sidebar = () => {
  const [step1, setStep1] = useState(1);
  const { logout } = useAuth();



  const handleLogout = () => {
    logout();
    window.location.href = "/";
  };
  return (
    <div
      className="d-flex justify-content-between flex-column  text-black vh-100 pe-5"
      style={{ backgroundColor: "#333547" }}
    >
      <div className="ms-3">
        <Link to="/Dashboard">
          {/* <i clLinkssName='bi bi-code-slash fs-4 me-4'></i> */}
          <img
            src="../MMLogo3.png"
            style={{ height: "35px" }}
            className="ms-3 mt-2 "
            alt="CoolBrand"
          />
        </Link>
        {/* <hr className='text-secondary '/> */}
        <ul className="nav nav-pills flex-column  list-unstyled  mt-2">
          <li
            className={
              step1 === 1 ? "nav-item my-3 ml-2 active" : "nav-item my-3 ml-2"
            }
            onClick={(e) => setStep1(1)}
          >
            <Link to="/dashboard">
              <i className="bi bi-house  mx-2 "></i>
              <span>Dashboard</span>
            </Link>
          </li>

          <li
            className={
              step1 === 2 ? "nav-item my-3 ml-2 active" : "nav-item my-3 ml-2"
            }
            onClick={(e) => setStep1(2)}
          >
            <Link to="/posts">
              <i class="bi bi-file-earmark-image  mx-2"></i>
              <span>Posts</span>
            </Link>
          </li>

          <li
            className={
              step1 === 3 ? "nav-item my-3 ml-2 active" : "nav-item my-3 ml-2"
            }
            onClick={(e) => setStep1(3)}
          >
            <Link to="/paparazzi">
              <i class="bi bi-camera-video  mx-2"></i>
              <span>Videos</span>
            </Link>
          </li>
          <li
            className={
              step1 === 4 ? "nav-item my-3 ml-2 active" : "nav-item my-3 ml-2"
            }
            onClick={(e) => setStep1(4)}
          >
            <Link to="/dashboard">
              <i class="bi bi-file-earmark-image  mx-2"></i>
              <span>Rss Details</span>
            </Link>
          </li>
          <li
            className={
              step1 === 5 ? "nav-item my-3 ml-2 active" : "nav-item my-3 ml-2"
            }
            onClick={(e) => setStep1(5)}
          >
            <Link to="/">
              <i class="bi bi-quote  mx-2"></i>
              <span>Visual Stories</span>
            </Link>
          </li>
          <li
            className={
              step1 === 6 ? "nav-item my-3 ml-2 active" : "nav-item my-3 ml-2"
            }
            onClick={(e) => setStep1(6)}
          >
            <Link to="/dashboard">
              <i className="bi bi-newspaper  mx-2"></i>
              <span>Trending News</span>
            </Link>
          </li>
          <li
            className={
              step1 === 7 ? "nav-item my-3 ml-2 active" : "nav-item my-3 ml-2"
            }
            onClick={(e) => setStep1(7)}
          >
            <Link to="/dashboard">
              <i className="bi bi-people  mx-2"></i>
              <span>Roles</span>
            </Link>
          </li>
          <li
            className={
              step1 === 8 ? "nav-item my-3 ml-2 active" : "nav-item my-3 ml-2"
            }
            onClick={(e) => setStep1(8)}
          >
            <Link to="/dashboard">
              <i class="bi bi-people  mx-2"></i>
              <span>Create Users</span>
            </Link>
          </li>
          <li
            className={
              step1 === 9 ? "nav-item my-3 ml-2 active" : "nav-item my-3 ml-2"
            }
            onClick={(e) => setStep1(9)}
          >
            <Link to="/Category">
              <i className="bi bi-bookmarks-fill mx-2"></i>{" "}
              <span>Category</span>
            </Link>
          </li>
        </ul>
      </div>
      <div>
        <hr className="text-secondary mt-2 " /> 

         <Link to=" " className='p-2'>
                  <i className='bi bi-code-slash fs-4 me-4'></i>
                  <span className='fs-4' onClick={handleLogout}>  Log out</span>
            </Link>
      </div>
    </div>
  );
};

export default Sidebar;
